vIdUsuario int;
BEGIN

    DELETE FROM DIRECCION
    WHERE PIDUSUARIO = direccion.idusuario
    RETURNING DIRECCION.IDUSUARIO INTO vIdUsuario;


    DELETE FROM USUARIO 
    WHERE USUARIO.idusuario = vIdUsuario;




END UsuarioDireccionDelete;

